t=0
x=96
y=24

function TIC()

	if btn(0) then y=y-1 end
	if btn(1) then y=y+1 end
	if btn(2) then x=x-1 end
	if btn(3) then x=x+1 end

	cls(13)
	spr(1+t%60//30*2,x,y,14,3,0,0,2,2)
	print("HELLO WORLD!",84,84)
	t=t+1
end

--[[ This is a lazer particle effect from Pico-8 may work
_set_fps(60)
pal(3,140,1)
hx,hy,hw,hh,bb,r=64,100,0,4,{},4
t,bt,bg,f=0,0,0,1
c={8,9,10,7,7,7,7,10,10}
ef={r=10,sr=0}
::_::
t+=1
if t%200<8 then
	bg=7
else
	bg=0
end
cls(bg)

-- flash effect
if t%200<15 then
	if stat(24)!=1 then music(1) end
	ef.r+=ef.r*0.2
	bt=hy-ef.r
	circfill(hx,hy-5,ef.r,9)
	circfill(hx+1,hy-4,ef.r-3,bg)
	local l=flr(rnd(20))
	for i=0,l do
		local r,s,c=rnd(20)+20,sin(i/l),cos(i/l)
		local gx,gy=s*120,c*120
		line(hx,hy,64+gx,64+gy,9)
	end
else
	bt=0
	ef.r=10
end

for i=1,hw do
	ovalfill(hx-hw+i-r+i*3, hy-hh+ceil(i/3), hx+hw-i+r-i*3 ,hy+hh+4-i ,c[i])
	rectfill(hx-hw+i, bt, hx+hw-i, hy-hh+2+i ,c[i])
end

-- particle effect
add(bb,{x=hx+(flr(rnd(hw*3)-hw*1.5)),y=hy-3,l=ceil(rnd(40))+20,c=6+flr(rnd(3))+1})
for b in all(bb) do
	local x,n=b.x+sin((b.x+b.y)/50)*2,flr(rnd(#bb)+1)
	pset(x,b.y,b.c)
	b.y-=b.y*rnd(10)/100
	b.l-=1
-- spark effect
	if n%10==0 then 
		line(b.x,b.y,bb[n].x,bb[n].y,7)
	end
	if b.l<0 then del(bb,b) end
end


if t%2==0 then
	hw+=1*f
	r+=3*f
	if hw>=10 then hw=8 end
	if r>=20 then r=20 end
end
if t%200==0 then
	hw,r,t,bb=0,4,0,{}
	hx=flr(rnd(80)+40)
	hy=flr(rnd(40)+80)
end
flip()
goto _
